using System;
using System.Collections.Generic;
using System.Linq;

namespace CountingValleys
{
    internal class Program
    {
        private static void Main()
        {
            Console.WriteLine(CountingValleys(100000, ""));
            Console.ReadLine();
        }

        public static int CountingValleys(int steps, string path)
        {
            char[] count = path.ToCharArray();
            int location = 0;
            int result = 0;
            foreach (var _char in count)
            {
                if (_char == 'U') location += 1;
                else location -= 1;
                if (_char == 'U' && location == 0) result++;
            }
            return result;
        }
    }
}